import React, { useState } from 'react';
import { Transition } from '@headlessui/react';

function Slider() {
  const [seccionAnimacion, setSeccionAnimacion] = useState('Inicio');
  const [fondoAnimacion, setFondoAnimacion] = useState('');

  const navegacion = (seccion) => {
    setFondoAnimacion(seccion); // Establecer la clase de animación de fondo
    setTimeout(() => {
      setSeccionAnimacion(seccion); // Cambiar la sección después de la animación
    }, 300); // Ajustar este valor para que coincida con la duración de la animación CSS
    const elemento = document.getElementById(seccion);
    if (elemento) {
      elemento.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="relative">
      <nav className="fixed top-0 left-0 right-0 flex justify-center items-center py-4 z-50">
        <div className="ml-96 mr-96 flex justify-center items-center rounded-full shadow-md bg-white">
          <button
            onClick={() => navegacion('Inicio')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ${
              seccionAnimacion === 'Inicio' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Inicio
          </button>
          <button
            onClick={() => navegacion('Tecnologias')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ml-4 ${
              seccionAnimacion === 'Tecnologias' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Tecnologías
          </button>
          <button
            onClick={() => navegacion('ExperienciayFormacion')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ml-4 ${
              seccionAnimacion === 'ExperienciayFormacion' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Experiencia y Formación
          </button>
          <button
            onClick={() => navegacion('Proyectos')}
            className={`hover:bg-gray-200 hover:text-gray-800 py-2 px-4 focus:outline-none rounded-full ml-4 ${
              seccionAnimacion === 'Proyectos' ? 'bg-gray-200 text-gray-800' : ''
            }`}
          >
            Proyectos
          </button>
        </div>
      </nav>

      <Transition
        show={seccionAnimacion === 'Inicio'}
        enter={`transition-opacity ease-out duration-500`}
        enterFrom="opacity-0"
        enterTo="opacity-100"
        leave={`transition-opacity ease-in duration-300`}
        leaveFrom="opacity-100"
        leaveTo="opacity-0"
      >
        <div id="Inicio" className="h-screen flex flex-col items-center justify-center">
          <h2 className="text-4xl font-bold">Inicio</h2>
          <p className="mt-2">Scroll Down for next slide</p>
        </div>
      </Transition>

      <Transition
        show={seccionAnimacion === 'Tecnologias'}
        enter={`transition-opacity ease-out duration-500`}
        enterFrom="opacity-0"
        enterTo="opacity-100"
        leave={`transition-opacity ease-in duration-300`}
        leaveFrom="opacity-100"
        leaveTo="opacity-0"
      >
        <div id="Tecnologias" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-indigo-800 to-purple-800 text-white">
          <h2 className="text-4xl font-bold">Tecnologías</h2>
          <p className="mt-2">Scroll Down for next slide</p>
        </div>
      </Transition>

      <Transition
        show={seccionAnimacion === 'ExperienciayFormacion'}
        enter={`transition-opacity ease-out duration-500`}
        enterFrom="opacity-0"
        enterTo="opacity-100"
        leave={`transition-opacity ease-in duration-300`}
        leaveFrom="opacity-100"
        leaveTo="opacity-0"
      >
        <div id="ExperienciayFormacion" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-purple-800 to-pink-800 text-white">
          <h2 className="text-4xl font-bold">Experiencia y Formación</h2>
          <p className="mt-2">Scroll Down</p>
        </div>
      </Transition>

      <Transition
        show={seccionAnimacion === 'Proyectos'}
        enter={`transition-opacity ease-out duration-500`}
        enterFrom="opacity-0"
        enterTo="opacity-100"
        leave={`transition-opacity ease-in duration-300`}
        leaveFrom="opacity-100"
        leaveTo="opacity-0"
      >
        <div id="Proyectos" className="h-screen flex flex-col items-center justify-center bg-gradient-to-b from-blue-200 to-indigo-100 text-black">
          <h2 className="text-4xl font-bold">Proyectos</h2>
        </div>
      </Transition>

      {/* Estilo dinámico para animación del fondo */}
      <style>
        {`
          .bg-slide-enter-active {
            transition: transform 0.3s ease-out;
          }
          .bg-slide-enter-from {
            transform: translateX(-100%);
          }
          .bg-slide-enter-to {
            transform: translateX(0);
          }
          .bg-slide-leave-active {
            transition: transform 0.3s ease-in;
          }
          .bg-slide-leave-from {
            transform: translateX(0);
          }
          .bg-slide-leave-to {
            transform: translateX(100%);
          }
          .bg-slide-leave-done {
            display: none;
          }
        `}
      </style>

      {/* Fondo animado */}
      <Transition
        show={fondoAnimacion !== ''}
        enter={`bg-slide-enter bg-slide-enter-active`}
        enterFrom={`bg-slide-enter-from`}
        enterTo={`bg-slide-enter-to`}
        leave={`bg-slide-leave bg-slide-leave-active bg-slide-leave-from`}
        leaveTo={`bg-slide-leave-to bg-slide-leave-done`}
        className="absolute inset-0 z-0 bg-gradient-to-r from-indigo-800 to-purple-800"
      />
    </div>
  );
}

export default Slider;
